Question: How to access value "p"? Answer should be like obj[key or index 1][key or index 2][key or index 3]...

Input: 
{
"id":"g",
"Z":"q",
"subs":[
 {
 "id":"h",
 "Y":"p",
 "subs":[
  {
  "id":"i",
  "X":"o",
  "subs":[]
  }
 ]
 }
]
}

To access the value "p" in the given JSON-like structure, you can navigate through the nested objects and arrays using the appropriate keys and indices. Starting from the outermost object, you'll need to access the "subs" key, which contains an array. Then, select the first element of that array (index 0), and within that object, look for the key "Y" which holds the value "p".

The access expression will be:

```plaintext
obj["subs"][0]["Y"]
```

If you were assigning this structure to a variable named `obj`, here's how you would retrieve "p":

```javascript
var obj = {
  "id":"g",
  "Z":"q",
  "subs":[
   {
     "id":"h",
     "Y":"p",
     "subs":[
      {
        "id":"i",
        "X":"o",
        "subs":[]
      }
     ]
   }
  ]
};

var valueP = obj["subs"][0]["Y"]; // valueP will be 'p'
```

This will give you the desired value "p".

